@tupambaps @nelly_sartori Son resoluciones de las inspecciones basadas en normativa que tiene muchos años, se basan en la cantidad de niños.Siempre ha sido así y no estamos innovando.
Aprovecho para comentar que aprobamos la construcción del nuevo liceo para Tupambae por más de 1.300.000 dólares.
Saludos
